% W23/Les7
%
% lesion_exp_level 1 = low expression (tall plants, green leaves, chlorotic lesions), 
%                  2 = more expression (shorter plants, usually with no ears, ok but not great tassels, lots of necrotic lesions), 
%                  3 = extreme expression (shorter plants, miserable tassels, perhaps weak pollen production, covered with necrotic lesions),
%                2.5 = and slowly developing extreme expression (like extreme expression, but develops more slowly so that at 
%                      intermediate times the leaf is basically green with large numbers of necrotic lesions)
%
%
%
% At the date of initial observation --- just before I pollinated with the W23/Les7s
% --- the plants scored 2.5 were markedly greener,
% but the number and size of the lesions was about the same as those plants scored 3.  
% At the time these data were recorded, the plants were just as brown and saturated
% with lesions as the plants scored 3 in that family.  So this is a kinetic effect.
%
% Kazic, 24.8.09
%



